Reporter Christine Byers is on the scene of an officer-involved shooting in the 3200 block of St. Louis Avenue.  Follow her on Twitter:
www.twitter.com/ChristineDByers
@ChristineDByers

Congratulations to the winning couples in our 2nd annual St. Louis' Best Bridal Groom's Cake Dive:
Steven Thomas and Stephanie Whetstone; Travis Schepker and Brittany Joseph; Jack Hanten and Alissa Ontiberos; Mitch Duffield and Marianne Sicking; Michael Elliott and Nakia Billups;
Todd DeWees and Maggie Dust; Dale Davis and Dominic Siebert;
Jim Petersen and Ali Holmes; Doug Rieber and Margaret Roberts;
Robert Capriglione and Sarah Reis; Kenneth Hunter and Karen Durham; Jason Dothage and Angie Jones.

On Sept. 5, the soon-to-be grooms will dive face-first into a McArthur's Bakery groom's wedding cake at Busch Stadium
to battle for great prizes from our sponsors: Savvi Formalwear, 
Travel Haus of St Louis, Walter Knoll Florist, Trotter Photo of St. Louis, The Bridal Shoppe, St. Charles Convention Center, Exceed Limo, Orlando's Catering and Banquets, Panache and Promises and Grand Rental Station.

Learn more about the event here: http://postdispat.ch/1JwitxN

Don't miss out on YOUR chance to win!  Sign up for our "Contests and Promotions"  newsletter at www.stltoday.com/newsletter
